import React from "react";
import css from "./index.module.scss";
function Home() {
  console.log(process.env);
  const handleNavigate = (e) => (path) => {
    e.preventDefault();
    console.log(path);
  };
  return (
    <div className={css.root}>
      {/* <Header />
      <Content/> */}
      <header>
        <div className={css.nav}>
          <ul>
            <li onClick={(e) => handleNavigate(e, "Movies")}>Movies</li>
            <li onClick={(e) => handleNavigate(e, "Characters")}>Characters</li>
            <li>Planets</li>
            <li>Species</li>
            <li>Vehicles</li>
            <li>Starships</li>
          </ul>
        </div>
      </header>
    </div>
  );
}

export default Home;
